&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;83805; Panel Policristalino de 1.2W/5.5V, PET, Entrada DC : 5V/1A, Salida DC: 5V/2A, Bateria 5000mAh.&lt;/p&gt;
&lt;p&gt;Tiempo de carga full 4-5 horas a toma corriente para cargar dispositivos, tiempo de carga Solar 2-4 horas expuesto a sol para usar iluminaci&oacute;n y linterna. Incluye cable conexi&oacute;n y Arn&eacute;s.&lt;/p&gt;
&lt;p&gt;Indicador de carga, Iluminaci&oacute;n LED tipo linterna, garant&iacute;a 6 meses por defectos de fabricaci&oacute;n. Resistente e exteriores, 2 salidas de USB. Marca PS.&lt;/p&gt;
&lt;p&gt;&lt;b&gt;T&eacute;rminos&lt;/b&gt;&lt;strong&gt;&nbsp;y condiciones:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Garant&iacute;a de 6 meses por defectos de f&aacute;brica, no cubre mal uso ni mal trato, el equipo pierde garant&iacute;a si se destapa por el cliente, la garant&iacute;a se hace efectiva con la factura de venta.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Tiempo de entrega:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;De 3 a 7 d&iacute;as h&aacute;biles.&lt;/p&gt;

